import React, {Fragment, useState} from "react";

const Contador = () =>{
    const [numero, setNumero] = useState(0)
    const Aumentar = () =>{
        setNumero(numero + 1)
    }
    const Reducir = () =>{
        setNumero(numero - 1)
    }
    return(
        <Fragment>
            <h2> Contador: {numero} </h2>
            <button onClick = {Aumentar} >+</button>
            <button onClick = {Reducir}>-</button>
        </Fragment>
    )

}
export default Contador
